import React from "react";

function DeleteQuizPopup() {
  return (
    <div
      style={{
        height: "35vh",
        width: "57vw",
        marginTop: "30vh",
        marginLeft: "3vw",
        backgroundColor: "pink",
        borderRadius: "10px",
      }}
    >
      <p
        style={{
          fontSize: "2.5em",
          fontWeight: "600",
          color: "#474444",
          textAlign: "center",
          margin
        }}
      >
        Are you confirm you want to delete ?
      </p>
    </div>
  );
}

export default DeleteQuizPopup;
